import './Fpoa.css';
const Fpoa = () =>{
    return(
        <div className="fpoa-container">
            <h2 className="fpoa-heading">What Are you Looking For?</h2>
            <div className="fpoa-box">
                <h2 className="fpoa-box-heading"> <i class="fa-solid fa-calendar"></i> Flxturs & Result </h2>
                <h2 className="fpoa-box-heading"> <i class="fa-solid fa-chart-simple"></i> Plonts Table</h2>
                <h2 className="fpoa-box-heading"> <i class="fas fa-chart-line"></i>  overAll Stats </h2>
                <h2 className="fpoa-box-heading"> <i class="fas fa-user-group"></i> All Teams </h2>
            </div>

        </div>
    );
}
export default Fpoa;
